import React from 'react';
import {Button} from 'react-bootstrap'
import Header from './components/Header'
import Footer from './components/Footer'


function App() {
  return (
    <div className="App">
      <Header/>
        <Button variant="primary">Primary</Button>{' '}
       <Footer />
    </div>
  );
}

export default App;
